import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'control-de-gastos';

  constructor(private router:Router){

  }

  Listar(){
    this.router.navigate(["listar"]) //se pone el nombre que pusimos en path de app-routing
  }
  Nuevo(){
    this.router.navigate(["agregar"])
  }
}
<div style="text-align: center;">
<h1>
  bienvenido to {{title}}
</h1>
</div>
<div class="container">
  <button (click)="Listar()" class="btn btn-info">Listar</button>
  <button (click)="Nuevo()" class="btn btn-info" style="margin-left: 10px;">Nuevo</button>

</div>

<router-outlet></router-outlet>
